    var allElements = Object.keys(elementMap);

    function hasType(token, type) {
        var tokenTypes = token.type.split('.');
        return type.split('.').every(function(type){
            return (tokenTypes.indexOf(type) !== -1);
        });
    }

    function findTagName(session, pos) {
        var iterator = new TokenIterator(session, pos.row, pos.column);
        var token = iterator.getCurrentToken();
        if (!token || !hasType(token, 'tag') && !(hasType(token, 'text') && token.value.match('/'))){
            do {
                token = iterator.stepBackward();
            } while (token && (hasType(token, 'string') || hasType(token, 'operator') || hasType(token, 'attribute-name') || hasType(token, 'text')));
        }
        if (token && hasType(token, 'tag.name') && !iterator.stepBackward().value.match('/'))
            return token.value;
    }

    function findTagParentName(session, pos) {
        var iterator = new TokenIterator(session, pos.row, pos.column);
        var token = iterator.stepBackward();
        var lastClosingToken = null;
        var isClosingTag = token.value.match('</');
        var found = false;
        var stack = [];
        while (token && !found) {
            if (hasType(token, "tag.name")) {
                if (lastClosingToken.value.match("/>")) {
                    // Self closing tag
                } else if (iterator.stepBackward().value.match('/')) {
                    // closing tag
                    stack.push(token.value);
                } else if (stack.length > 0 && stack[stack.length - 1] === token.value) {
                    // opening tag
                    stack.pop();
                } else if (isClosingTag) {
                    // this should be the opening tag
                    isClosingTag = false;
                } else {
                    // parent tag
                    found = true;
                    break;
                }
            }

            // Store the last ending tag so we can tell if it's a self closing tag
            if (hasType(token, "meta.tag.punctuation.end")) {
                lastClosingToken = token;
            }
            token = iterator.stepBackward();
        }

        if (token)
            return token.value;
    }

    var DocBook50Completions = function() {

    };

    (function() {

        this.getCompletions = function(state, session, pos, prefix) {
            var token = session.getTokenAt(pos.row, pos.column);
            var prevToken = session.getTokenAt(pos.row, pos.column - prefix.length);

            if (!token)
                return [];

            // tag name
            if (hasType(token, "tag.name") || (prevToken && prevToken.value.trim() == '<' && hasType(prevToken, "text")))
                return this.getTagCompletions(state, session, pos, prefix);

            // tag attribute
            if (hasType(token, 'text') || hasType(token, 'attribute-name'))
                return this.getAttributeCompletions(state, session, pos, prefix);

            return [];
        };

        this.getTagCompletions = function(state, session, pos, prefix) {
            var parent = findTagParentName(session, pos);
            var elements;
            if (parent) {
                elements = elementMap[parent]["children"];
            } else {
                elements = allElements;
            }
            return elements.map(function(element){
                return {
                    value: element,
                    meta: "tag"
                };
            });
        };

        this.getAttributeCompletions = function(state, session, pos, prefix) {
            var tagName = findTagName(session, pos);
            if (!tagName)
                return [];
            var attributes = elementMap[tagName]["attributes"];
            return attributes.map(function(attribute){
                return {
                    caption: attribute,
                    snippet: attribute + '="$0"',
                    meta: "attribute"
                };
            });
        };

    }).call(DocBook50Completions.prototype);

    exports.DocBook50Completions = DocBook50Completions;
